document.addEventListener("DOMContentLoaded",()=>{const n=Array.prototype.slice.call(document.querySelectorAll(".navbar-burger"),0);n.length>0&&n.forEach(n=>{n.addEventListener("click",()=>{const t=n.dataset.target,i=document.getElementById(t);n.classList.toggle("is-active");i.classList.toggle("is-active")})})});